import { useState } from 'react';
function Index() {
  let data = localStorage.getItem("user-info");
  data = JSON.parse(data);
  const [merchantsList, setMerchants] = useState([]);

  async function getMerchants() {
    let result = await fetch("http://localhost:3001/api/v1/merchants", {
      method: 'GET',
      headers: {
        "Content-Type": 'application/json',
        "Accept": 'application/json',
        "uid": data['uid'],
        "client": data['client'],
        "access-token": data['access_token']
      }
    });

    result = await result.json();
    setMerchants(result);
    console.log("merchants:", merchantsList);
  }

  return (
    <>
      <div className="flex flex-inline justify-center justify-item-center">
        Merchants
      </div>

      <div>
        <table className="table table-striped">
          <thead>
            <tr>
              <th className='px-9'>Id</th>
              <th className='px-9'>Name</th>
              <th className='px-9'>Address</th>
              <th className='px-9'>Phone</th>
            </tr>
          </thead>
          <tbody>
            {
              {merchantsList}.map((item) => (
                <tr key={item.id}>
                  <td className='px-9'>{item.id}</td>
                  <td className='px-9'>{item.name}</td>
                  <td className='px-9'>{item.address}</td>
                  <td className='px-9'>{item.phone}</td>
                </tr>
              ))
            }
          </tbody>
        </table>
      </div>

      <div>
        <button className="btn btn-primary" onClick={getMerchants}
          >Get Merchants
          </button>
      </div>
    </>

  );
}

export default Index;
